import React, {useEffect} from 'react';
import './App.css';
import {NoteLine} from './NoteLine';


useEffect(() =>{
  dispatch(loadDay(4,7))
},[dispatch]);


function App() {
  return (
    <div className="App">

      <div className="header">
        <div className="title"> Note-Tex </div>
      </div>

      <div className="middle">

        <div className="leftMargin">
          placeholder
        </div>

        <div className="body">
          <NoteLine key={1} noteLine={{id: 1,lineContents:"placeholder text of somesort"}}/>
        </div>

        <div className="rightMargin">
          placeholder
        </div>

      </div>

    </div>
  );
}

export default App;
